import React, { useState, useEffect } from 'react';
import { motion, AnimatePresence } from 'framer-motion';
import { PieChart, Pie, Cell, ResponsiveContainer, XAxis, YAxis, CartesianGrid, Tooltip, ScatterChart, Scatter } from 'recharts';
import { relationshipTypes, projects, metrics, insights } from '../data/projectsData';
import { Search, Filter, TrendingUp, Users, Brain, Database, Star, Zap, Network } from 'lucide-react';
import ProjectCard from './ProjectCard';
import InsightCard from './InsightCard';
import ProjectDetailModal from './ProjectDetailModal';
import './Dashboard.css';

const Dashboard = () => {
  const [selectedType, setSelectedType] = useState('All');
  const [searchTerm, setSearchTerm] = useState('');
  const [selectedProject, setSelectedProject] = useState(null);
  const [isModalOpen, setIsModalOpen] = useState(false);
  const [filteredProjects, setFilteredProjects] = useState(projects);

  const handleProjectClick = (project) => {
    setSelectedProject(project);
    setIsModalOpen(true);
  };

  const closeModal = () => {
    setIsModalOpen(false);
    setSelectedProject(null);
  };

  useEffect(() => {
    let filtered = projects;

    if (selectedType !== 'All') {
      filtered = filtered.filter(project => project.type === selectedType);
    }

    if (searchTerm) {
      filtered = filtered.filter(project => 
        project.name.toLowerCase().includes(searchTerm.toLowerCase()) ||
        project.description.toLowerCase().includes(searchTerm.toLowerCase())
      );
    }

    setFilteredProjects(filtered);
  }, [selectedType, searchTerm]);

  const containerVariants = {
    hidden: { opacity: 0 },
    visible: {
      opacity: 1,
      transition: {
        staggerChildren: 0.1
      }
    }
  };

  const itemVariants = {
    hidden: { y: 20, opacity: 0 },
    visible: {
      y: 0,
      opacity: 1,
      transition: {
        type: "spring",
        stiffness: 100
      }
    }
  };

  const RADIAN = Math.PI / 180;
  const renderCustomizedLabel = ({ cx, cy, midAngle, innerRadius, outerRadius, percent }) => {
    const radius = innerRadius + (outerRadius - innerRadius) * 0.5;
    const x = cx + radius * Math.cos(-midAngle * RADIAN);
    const y = cy + radius * Math.sin(-midAngle * RADIAN);

    return (
      <text 
        x={x} 
        y={y} 
        fill="white" 
        textAnchor={x > cx ? 'start' : 'end'} 
        dominantBaseline="central"
        fontSize={12}
        fontWeight="bold"
      >
        {`${(percent * 100).toFixed(1)}%`}
      </text>
    );
  };

  return (
    <motion.div 
      className="dashboard"
      variants={containerVariants}
      initial="hidden"
      animate="visible"
    >
      {/* Header */}
      <motion.header 
        className="dashboard-header"
        variants={itemVariants}
      >
        <div className="header-content">
          <h1 className="dashboard-title">
            Ocean Protocol Ecosystem Analysis
          </h1>
          <p className="dashboard-subtitle">
            Comprehensive analysis of AI/Blockchain project relationships with Ocean Protocol
          </p>
        </div>
      </motion.header>

      {/* Key Metrics */}
      <motion.section 
        className="metrics-section"
        variants={itemVariants}
      >
        <div className="metrics-grid">
          <motion.div 
            className="metric-card"
            whileHover={{ scale: 1.05 }}
            whileTap={{ scale: 0.95 }}
          >
            <div className="metric-icon">
              <Users size={24} />
            </div>
            <div className="metric-content">
              <h3>{metrics.totalProjects}</h3>
              <p>Total Projects Analyzed</p>
            </div>
          </motion.div>

          <motion.div 
            className="metric-card"
            whileHover={{ scale: 1.05 }}
            whileTap={{ scale: 0.95 }}
          >
            <div className="metric-icon">
              <Star size={24} />
            </div>
            <div className="metric-content">
              <h3>{metrics.averageCompatibilityScore}</h3>
              <p>Avg Compatibility Score</p>
            </div>
          </motion.div>

          <motion.div 
            className="metric-card"
            whileHover={{ scale: 1.05 }}
            whileTap={{ scale: 0.95 }}
          >
            <div className="metric-icon">
              <Network size={24} />
            </div>
            <div className="metric-content">
              <h3>{metrics.oceanNodesAverage}</h3>
              <p>Ocean Nodes Compatibility</p>
            </div>
          </motion.div>

          <motion.div 
            className="metric-card"
            whileHover={{ scale: 1.05 }}
            whileTap={{ scale: 0.95 }}
          >
            <div className="metric-icon">
              <Database size={24} />
            </div>
            <div className="metric-content">
              <h3>{metrics.dataNFTsAverage}</h3>
              <p>Data NFTs Integration</p>
            </div>
          </motion.div>

          <motion.div 
            className="metric-card"
            whileHover={{ scale: 1.05 }}
            whileTap={{ scale: 0.95 }}
          >
            <div className="metric-icon">
              <Zap size={24} />
            </div>
            <div className="metric-content">
              <h3>{metrics.computeToDataAverage}</h3>
              <p>Compute-to-Data Support</p>
            </div>
          </motion.div>

          <motion.div 
            className="metric-card"
            whileHover={{ scale: 1.05 }}
            whileTap={{ scale: 0.95 }}
          >
            <div className="metric-icon">
              <TrendingUp size={24} />
            </div>
            <div className="metric-content">
              <h3>{metrics.predictoorAverage}</h3>
              <p>Predictoor Synergy</p>
            </div>
          </motion.div>
        </div>
      </motion.section>

      {/* Charts Section */}
      <motion.section 
        className="charts-section"
        variants={itemVariants}
      >
        <div className="charts-grid">
          {/* Relationship Distribution */}
          <motion.div 
            className="chart-card"
            whileHover={{ scale: 1.02 }}
          >
            <h3>Relationship Type Distribution</h3>
            <ResponsiveContainer width="100%" height={300}>
              <PieChart>
                <Pie
                  data={relationshipTypes}
                  cx="50%"
                  cy="50%"
                  labelLine={false}
                  label={renderCustomizedLabel}
                  outerRadius={100}
                  fill="#8884d8"
                  dataKey="value"
                >
                  {relationshipTypes.map((entry, index) => (
                    <Cell key={`cell-${index}`} fill={entry.color} />
                  ))}
                </Pie>
                <Tooltip 
                  formatter={(value) => [`${value}%`, 'Percentage']}
                  labelStyle={{ color: '#333' }}
                />
              </PieChart>
            </ResponsiveContainer>
          </motion.div>

          {/* Synergy vs AI Integration */}
          <motion.div 
            className="chart-card"
            whileHover={{ scale: 1.02 }}
          >
            <h3>Synergy vs AI Integration</h3>
            <ResponsiveContainer width="100%" height={300}>
              <ScatterChart>
                <CartesianGrid strokeDasharray="3 3" stroke="#f0f0f0" />
                <XAxis 
                  type="number" 
                  dataKey="synergy" 
                  name="Synergy" 
                  domain={[0, 10]}
                  tick={{ fill: '#666' }}
                />
                <YAxis 
                  type="number" 
                  dataKey="aiIntegration" 
                  name="AI Integration" 
                  domain={[0, 10]}
                  tick={{ fill: '#666' }}
                />
                <Tooltip 
                  cursor={{ strokeDasharray: '3 3' }}
                  formatter={(value, name) => [value, name]}
                  labelFormatter={(value) => ''}
                  labelStyle={{ color: '#333' }}
                />
                <Scatter 
                  name="Projects" 
                  data={projects} 
                  fill="#ff69b4"
                />
              </ScatterChart>
            </ResponsiveContainer>
          </motion.div>
        </div>
      </motion.section>

      {/* Filters and Search */}
      <motion.section 
        className="filters-section"
        variants={itemVariants}
      >
        <div className="search-container">
          <div className="search-input-wrapper">
            <Search size={20} />
            <input
              type="text"
              placeholder="Search projects..."
              value={searchTerm}
              onChange={(e) => setSearchTerm(e.target.value)}
              className="search-input"
            />
          </div>
        </div>

        <div className="filter-buttons">
          <Filter size={20} />
          {['All', ...relationshipTypes.map(type => type.name)].map(type => (
            <motion.button
              key={type}
              className={`filter-btn ${selectedType === type ? 'active' : ''}`}
              onClick={() => setSelectedType(type)}
              whileHover={{ scale: 1.05 }}
              whileTap={{ scale: 0.95 }}
            >
              {type}
            </motion.button>
          ))}
        </div>
      </motion.section>

      {/* Projects Grid */}
      <motion.section 
        className="projects-section"
        variants={itemVariants}
      >
        <h3>Project Portfolio ({filteredProjects.length} projects)</h3>
        <motion.div 
          className="projects-grid"
          layout
        >
          <AnimatePresence>
            {filteredProjects.map(project => (
              <ProjectCard
                key={project.id}
                project={project}
                onClick={() => setSelectedProject(project)}
              />
            ))}
          </AnimatePresence>
        </motion.div>
      </motion.section>

      {/* Insights Section */}
      <motion.section 
        className="insights-section"
        variants={itemVariants}
      >
        <h3>Strategic Insights</h3>
        <div className="insights-grid">
          {insights.map((insight, index) => (
            <InsightCard key={index} insight={insight} />
          ))}
        </div>
      </motion.section>

      {/* Project Detail Modal */}
      <AnimatePresence>
        {selectedProject && (
          <motion.div
            className="modal-overlay"
            initial={{ opacity: 0 }}
            animate={{ opacity: 1 }}
            exit={{ opacity: 0 }}
            onClick={() => setSelectedProject(null)}
          >
            <motion.div
              className="modal-content"
              initial={{ scale: 0.7, opacity: 0 }}
              animate={{ scale: 1, opacity: 1 }}
              exit={{ scale: 0.7, opacity: 0 }}
              onClick={(e) => e.stopPropagation()}
            >
              <button 
                className="modal-close"
                onClick={() => setSelectedProject(null)}
              >
                Ã—
              </button>
              <div className="modal-header">
                <h2>{selectedProject.name}</h2>
                <span className={`type-badge ${selectedProject.type.toLowerCase().replace(' ', '-')}`}>
                  {selectedProject.type}
                </span>
              </div>
              <p className="modal-description">{selectedProject.description}</p>

              <div className="modal-metrics">
                <div className="modal-metric">
                  <span>Synergy</span>
                  <div className="progress-bar">
                    <motion.div 
                      className="progress-fill"
                      initial={{ width: 0 }}
                      animate={{ width: `${selectedProject.synergy * 10}%` }}
                      transition={{ delay: 0.2, duration: 0.8 }}
                    />
                  </div>
                  <span>{selectedProject.synergy}/10</span>
                </div>
                <div className="modal-metric">
                  <span>Data Focus</span>
                  <div className="progress-bar">
                    <motion.div 
                      className="progress-fill"
                      initial={{ width: 0 }}
                      animate={{ width: `${selectedProject.dataFocus * 10}%` }}
                      transition={{ delay: 0.3, duration: 0.8 }}
                    />
                  </div>
                  <span>{selectedProject.dataFocus}/10</span>
                </div>
                <div className="modal-metric">
                  <span>AI Integration</span>
                  <div className="progress-bar">
                    <motion.div 
                      className="progress-fill"
                      initial={{ width: 0 }}
                      animate={{ width: `${selectedProject.aiIntegration * 10}%` }}
                      transition={{ delay: 0.4, duration: 0.8 }}
                    />
                  </div>
                  <span>{selectedProject.aiIntegration}/10</span>
                </div>
                <div className="modal-metric">
                  <span>Decentralization</span>
                  <div className="progress-bar">
                    <motion.div 
                      className="progress-fill"
                      initial={{ width: 0 }}
                      animate={{ width: `${selectedProject.decentralization * 10}%` }}
                      transition={{ delay: 0.5, duration: 0.8 }}
                    />
                  </div>
                  <span>{selectedProject.decentralization}/10</span>
                </div>
              </div>

              <div className="modal-features">
                <h4>Key Features</h4>
                <ul>
                  {selectedProject.keyFeatures.map((feature, index) => (
                    <li key={index}>{feature}</li>
                  ))}
                </ul>
              </div>

              <a 
                href={selectedProject.website} 
                target="_blank" 
                rel="noopener noreferrer"
                className="modal-link"
              >
                Visit Website
              </a>
            </motion.div>
          </motion.div>
        )}
      </AnimatePresence>
    </motion.div>
  );
};

export default Dashboard;
